tables.table_schema:
CREATE TABLE course_completion (course_id INT,
student_id INT,
completion_date DATE,
completion_status VARCHAR(50)
);

CREATE TABLE CourseCompletionRates (
  course_id INT PRIMARY KEY,
  completion_rate DECIMAL
);

CREATE TABLE StudentEngagement (
  student_id INT PRIMARY KEY,
  course_id INT,
  engagement_rate DECIMAL,
  FOREIGN KEY (course_id) REFERENCES CourseCompletionRates(course_id)
);

CREATE TABLE course_completion (
    student_id INT PRIMARY KEY,
    course_id INT,
    completion_status BOOLEAN
);

CREATE TABLE student_details (
    student_id INT PRIMARY KEY,
    student_name VARCHAR(50),
    enrolled_courses INT
);

CREATE TABLE course_details (
    course_id INT PRIMARY KEY,
    course_name VARCHAR(100),
    instructor_name VARCHAR(50)
);

CREATE TABLE Course (
  course_id INT PRIMARY KEY,
  course_name TEXT NOT NULL,
  completion_rate FLOAT
);

CREATE TABLE Student (
  student_id INT PRIMARY KEY,
  student_name TEXT NOT NULL,
  enrollment_date DATE
);

CREATE TABLE Enrollment (
  enrollment_id INT PRIMARY KEY,
  student_id INT REFERENCES Student(student_id),
  course_id INT REFERENCES Course(course_id),
  enrollment_date DATE
);

CREATE TABLE Completion (
  completion_id INT PRIMARY KEY,
  student_id INT REFERENCES Student(student_id),
  course_id INT REFERENCES Course(course_id),
  completion_date DATE
);
